Всем привет!
Наша Data Science команда в Neurodata Lab расширяется, и ищет новых людей.

Компания уже прошла долгий путь от момента, когда мы вкладывали все усилия в разработку разных технологий и,наконец, пришло время для продуктов. Основная технология - это  мультимодальное распознавание эмоций, где мы смотрим не только на лицо, а добавляем туда каналы речи (голос, слова) и тела (движение, физиология).

Мы ищем человека уровня *middle/senior*, который сможет обеспечить полный ML пайплайн: сбор данных, выбор архитектуры, обучение и тестирование модели, обертка в работающие модули и введение в продакшн.

Ты - наш идеальный кандидат, если:
• умеешь решать задачи классификации, детекции, сегментации, умеешь работать с GANами;
• работаешь на mxnet или pytorch;
• не ограничиваешься нейросетями и знаешь где лучше применить классический ML;
• умеешь оборачивать готовые модели в легковесные и легко тестируемые скрипты и собирать Docker-контейнеры;
• можешь проводить код-ревью и отдавать свой код туда без боли.

Будет супер круто, если ты:
• умеешь писать на плюсах;
• имеешь опыт с TensorRT;
• умеешь и хочешь писать статьи и выступать на конференциях.

У нас свежая амбициозная команда из 5 датасаенсов, которых вовсю идейно поддерживает ресёрч отдел: биологи, психологи, физиологи. Есть даже один *доктор наук* :birthdaypartyparrot:

Нашему новому тиммейту можем предложить:
• белую з/п *130-210К gross*;
• офис в бизнес-центре Верейская Плаза (м.Славянский бульвар);
• свое топовое железо для работы;
• наши сервера и облака для обучения;
• почтикаждопятничные тусовочки;
• возможность релокации в Штаты или Швейцарию.

Дочитал? Пиши - <mailto:a.belyaev@neurodatalab.com|a.belyaev@neurodatalab.com>

Компании-разработчику Амигокар (<http://amigocar.ru|amigocar.ru>)  систем компьютерного зрения требуется программист С/C++. Вы получите возможность участвовать в создании конкурентоспособного продукта в команде одной из ведущих инновационных компаний-резидентов Сколково.

Участвуя под руководством опытных профессионалов в создании встроенного ПО на базе передовых технологий машинного обучения, вы имеете шанс существенно укрепить Ваши профессиональные навыки.

Обязанности:
- разработка мультитредовой среды для функционирования библиотек распознавания и трекинга образов;
- разработка средств комплексного тестирования ПО;
- разработка базовых подпрограмм отображения информации в режиме реального времени.

Основные требования:
- опыт работы программистом С/C++ от 1,5 лет;
- знание систем контроля версий;
- В/О от одного из ведущих ВУЗов России;
- практический опыт создания мультитредовых систем на базе ОС Linux;
- навыки написания высокоэффективного кода на С/C++.

Плюсом будет:
- теоретическая подготовка и/или опыт работы в сфере CV или DSP;
- опыт работы с интерфейсами ввода видеопотоков;
- тайм-менеджмент, умение формулировать идеи.

